                ["customText"] = "function()\
          if WeakAuras.IsOptionsOpen() then\
              local highest = math.random(300, 700)\
              local myhp = 500\
              local max = 1000\
              if highest >= myhp then -- other collectors have more hp than the one the player is targeting\
                  local diff = highest-myhp\
                  local perc = Round((diff*1000)/max)/10\
                  return \"|cFFFF0000+ \"..perc\
              else -- our collector has the highest hp            \
                  local diff = myhp-highest -- if our collector has the highest hp we compare to the 2nd highest which will still be stored in this variable\
                  local perc = Round((diff*1000)/max)/10\
                  return \"|cFF00FF00- \"..perc\
              end\
          elseif aura_env.state and aura_env.state.health then\
              local highest = 0\
              local myhp = aura_env.state.health\
              for i=2, 10 do\
                  local u = \"boss\"..i\
                  if UnitExists(u) and select(6, strsplit(\"-\", UnitGUID(u))) == \"240905\" then\
                      if not UnitIsUnit(\"target\", u) then\
                          local hp = UnitHealth(u)\
                          highest = math.max(highest, hp)\
                      end\
                  end\
              end    \
              if highest >= myhp then -- other collectors have more hp than the one the player is targeting\
                  local diff = highest-myhp\
                  local perc = Round((diff*1000)/aura_env.state.maxhealth)/10\
                  return \"|cFFFF0000+ \"..perc\
              else -- our collector has the highest hp            \
                  local diff = myhp-highest -- if our collector has the highest hp we compare to the 2nd highest which will still be stored in this variable\
                  local perc = Round((diff*1000)/aura_env.state.maxhealth)/10\
                  return \"|cFF00FF00- \"..perc\
              end\
          end\
      end\
      \
